For example, when not using ng-view now we can retrieve the current route by:

    $route.match($location);

Or we could parse it:

    $location.$$parse($location.$$rewriteAppUrl('/index.html?id=2'));
    $route.match($location);

Paragraph says:
Notice the reference to the myApp module in the <html ng-app="myApp">, it is what bootstraps the app using your module.

But the code has:
<!-- index.html -->
    <!doctype html>
    <html ng-app="simpleApp">
    <head>
    <script src="http://code.angularjs.org/angular-1.0.1.min.js"></script>
    <script src="script.js"></script>
    </head>
    <body>
